import React from "react";
import {Switch, Route} from "react-router-dom";
import TagForm from "./components/TagForm";

export default function Routes() {
    return (
        <Switch>
            <Route exact path="/TagForm" >
                <TagForm />
            </Route>
        </Switch>
    );
}
